{"mediaType": 2, "likeCount": 19365, "commentCount": 60, "commentText": "This is me! I’m happiest behind a wheel, and when the road I’m on is in the rolling hills of Tuscany, I’m even happier 🤍

For CEAT’s 100th Year, I drove through Tuscany’s winding roads on CEAT SUV tyres, confidently and happily :) I walked through charming little towns, I laughed, I danced, and I had the most amazing gelato. Driving for me is about the experience, but it’s also about the places it takes me to and the people I get to travel with. What a trip! I’d do it again in a heartbeat 🤍

@ceat_tyresindia

