This iconic bronze statue in Sydney's Queen Square, unveiled on 22nd January 1879, stands as a testament to her enduring legacy. Ironically, on this day in 1901, Queen Victoria's remarkable reign came to an end. Standing regally atop Moruya Granite, her figure has watched over generations of Sydney siders for nearly 145 years. Shot in black and white to capture the timeless dignity of this historic monument, where Australian craftsmanship meets British heritage. The thick cluster of leaves behind creates a fitting backdrop for this memorial of the monarch who shaped an era. 👑 

